import React, { useState, useEffect } from "react";
import { useLocation, useParams,useNavigate, Navigate, createSearchParams } from "react-router-dom";
import axios from "axios";
import Header from "../layouts/Header";



export default function PatientDentalHistory()
{

    const location = useLocation();
    const [appointments, setAppointments] = useState([]);
    const ssn = new URLSearchParams(location.search).get('ssn');

    const fetchData = async () => {
        try {
          const response = await axios.get(`http://localhost:8080/appointments/getPatientAppointments/${ssn}`);
          setAppointments(response.data);
        } catch (error) {
          console.error('An error occurred:', error);
        }
    };

    useEffect(() => {
    fetchData();
    }, []);

    return <div>

        <Header title= {"ToothHub"}/>
        <div style={{width: "50%", margin: "5% 20%"}}>
        <table className="table table-striped">
                      <thead className="thead-light">
                        <tr>
                          
                          <th scope="col" style={{textAlign:"center"}}>Date </th>
                          <th scope="col" style={{textAlign:"center"}}>Time</th>
                          <th scope="col" style={{textAlign:"center"}}>Treatment</th>
                          
                        </tr>
                      </thead>
                      <tbody>
                        {appointments.map(appointment => (
                          <tr key={appointment.id}>
                            <td>{appointment.date}</td>
                            <td>{appointment.time}</td>
                            <td>{appointment.therapy}</td>
             
                          </tr>
                      ))}
                      </tbody>
                </table>
        </div>
    </div>













}
